import React, { Switch } from 'react';
import { BrowserRouter as Routes, Route } from 'react-router-dom';
import './App.css';
import Provedor from './contexto/Provedor';
import paginaPrincipal from './paginas/pagina-principal';

function App() {
  return (
    <Provedor>
        <Routes exact path='/' Component={ paginaPrincipal } />
    </Provedor>
  );
}

export default App;
